import SignInArea from '../components/organisms/signinarea'

export default () => (
    <div className="area">

        <div className="page">
            <Nav />
            <SignInArea />
            <style jsx>{`
                .page {
                    display: flex;
                }
            `}</style>
        </div>
    </div>

)
